        <li style="margin-left:29.67pt; text-align:justify; line-height:115%; padding-left:6.33pt; font-family:Arial; font-size:8pt; color:#538135;">El peso plasmado en esta Pre-factura ser&aacute; actualizado luego que el material culmine su proceso de clasificaci&oacute;n, pudiendo mermar su cantidad.</li>
